  01>. FAULKNER, Jean Anabelle m on 12.06.1929 to PARKER, Richard Charles
  b 03.03.1907 d 23.08.1997
  b 01.10.1904 d 09.05.1990
  Jean b. and m. at Gisborne. Richard, s/o Charles Parker, b. at Enfield, England and d, at Gisborne.
  Richard farmed "Enfield" station on the Hangaroa River before retiring to Wainui Beach in 1964.
  Enfield
  Located west of Gisborne on the Hangaroa River, "Enfield" was part of the "Te Aroha" block. It was
  purchased in 1930 by Richard Charles Parker and is now owned and farmed by Simon and Sally Parker.
  01> PARKER, James Allen m on 28.04.1954 to MATTHEWS, Lesley Anne
  b 08.06.1930
  b 13.11.1933
  James b. and m, at Gisborne. Anne, d/o Charles Edward Matthews and Mary Coop, b. at Gisborne.
  Address: 29 Domett Street, Gisborne.
  James was educated at Hereworth and Wanganui Collegiate School. He purchased 434 acres known as
  "Coolmoree" in 1956 and farmed it until it was sold in 1984. He has retired to a 13 acre block of
  land near Gisborne.
  Anne was educated at Woodford House and trained as a Karitane nurse.
  01> PARKER, Nichola Anne m on 15.04.1978 to COPPIN, Christopher
  b 19.07.1956
  b 29.08.1956
  Nichola b. and m, at Gisborne. Christopher, slo Les Coppin and Beverly Goddard, b. at Gisborne.
  Address: 46 Clawton Street, New Plymouth.
  Nichola was educated at Woodford House and worked for the Bank of New Zealand before marriage.
  Christopher was educated at Gisborne Boys' High School and works for an oil company.
